import classNames from 'classnames';

class Gallery extends React.Component {
  render() {
    return (
      <section className='gallery'>
        <div className='gallery-grid'>
          <img src='/static/bg_gallery_1.png' className='gallery-image-1' alt='' />
          <img src='' className='gallery-image-2' alt='' />
          <img src='' className='gallery-image-3' alt='' />
          <img src='/static/bg_gallery_5.png' className='gallery-image-4' alt='' />
          <img src='/static/bg_gallery_5.png' className='gallery-image-5' alt='' />
        </div>
        <style jsx>{`
          .gallery {
            grid-area: gallery;
          }
          .gallery-grid {
            display: grid;
            grid-gap: 20px;
            grid-template-columns: [C1]1fr [C2]1fr [C3]1fr [C4]1fr [C5];
            grid-template-rows: [R1]1fr [R2]1fr [R3]1fr [R4];
          }
          .gallery-image-1 {
            grid-column: C1/C3;
            grid-row: R1/R3;
          }
          .gallery-image-5 {
            grid-column: C4/C5;
            grid-row: R1/R2;
          }
          img {
            width: 100%;
          }
        `}</style>
      </section>
    )
  }

}

export default Gallery
